def lengthOfLongestSubstring(s: str) -> int:
    
        max_len = 0
        n = 0
        while n < len(s):
            substr = []
            if n >= (len(s) - max_len):
                return max_len
            for charac_ in s[n:]:
                if charac_ not in substr:
                    substr.append(charac_)

                else:
                    max_len = max(len(substr), max_len)

                    for idx, ch in enumerate(substr):
                        if ch == charac_:
                            matched_idx = idx
                            break
                    substr.append(charac_)
                    substr = substr[matched_idx+1:]
                    n = n + matched_idx + 1
                
            n = n+1 
            max_len = max(len(substr), max_len)
        return max_len

